import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = (props) => {
    return (
        <li>
            <Link href={`/post?title=${props.title}`}>
                <a>{props.title}</a>
            </Link>
        </li>
    );
}

const Index = () => {
    return (
        <Layout>
            <h3>My Blog</h3>
            <ul>
               <PostLink title="「Hello World」表示" content="Hello World出してみた" />
               <PostLink title="初めてのNextアプリ" content="Blogチュートリアルアプリに挑戦" /> 
            </ul>
        </Layout>
    );
}

export default Index;
